        img = img.clone()

    img[..., i:i + h, j:j + w] = v
    return img

def seconds_to_timestring(duration):

    if duration >= 1000e-3:
        return str(duration) + 's'
    if duration >= 1000e-6:
        return str(duration * 1e3) + 'ms'
    if duration >= 1000e-9:
        return str(duration * 1e6) + 'us'
    return str(duration * 1e9) + 'ns'

