def getTimeString(seconds):

    units = list()
    msecs = (seconds % 1) * 1000
    if msecs >= 1:
        units.append('{0}ms'.format(int(msecs % 60)))
    units.append('{0}s'.format(int(seconds % 60)))
    minutes = seconds/60
    if minutes >= 1:
        units.append('{0}m'.format(int(minutes % 60)))
        hours = minutes/60
        if hours >= 1:
            units.append('{0}h'.format(int(hours % 60)))
    return ' '.join(units[::-1])

