import torch

def mmd_polynomial_kernel(x, y, alpha=2):

    n, c, h, w = x.size()
    x = x.view(n * c, h * w)
    y = y.view(n * c, h * w)
    return 1 / (n * c * h * w) * torch.sum(torch.sum(x * y, dim=0).pow(alpha))

