def normalize_mask(mask, is_micro):

    if mask is None:
        return None
    try:
        mask = int(mask)
    except ValueError:
        raise ValueError('Invalid data mask "{0}". '
                         'Must be an integer or a string which represents an integer value.'.format(mask))
    if is_micro:
        if not 0 <= mask < 4:
            raise ValueError('Invalid data mask "{0}" for Micro QR Code. Must be in range 0 .. 3'.format(mask))
    else:
        if not 0 <= mask < 8:
            raise ValueError('Invalid data mask "{0}". Must be in range 0 .. 7'.format(mask))
    return mask

def isFractional_pt(input_str):

    if input_str.endswith('s', -1):
        input_str = input_str[:len(input_str) - 1]  # e.g. "fifths"

    aFrac = ["meio", u"tero", "quarto", "quinto", "sexto",
             "setimo", "oitavo", "nono", u"dcimo"]

    if input_str.lower() in aFrac:
        return 1.0 / (aFrac.index(input_str) + 2)
    if input_str == u"vigsimo":
        return 1.0 / 20
    if input_str == u"trigsimo":
        return 1.0 / 30
    if input_str == u"centsimo":
        return 1.0 / 100
    if input_str == u"milsimo":
        return 1.0 / 1000
    if (input_str == u"stimo" or input_str == "septimo" or
